import classes from "./Table.module.css";

const data = [
  {
    name: "Astha",
    employees: 19,
    approved: "Male",
    toAgency: "02-May",
    AmountToPay: "87,67,888",
    paid: "87,67,888",
    balance: "0",
    agencyToEmployee: "Delayed (17-May)",
    aadhaar: "211/226",
    leave: "leave",
  },
  { name: "Megha", age: 19, gender: "Female" },
  { name: "Subham", age: 25, gender: "Male" },
];

function Table() {
  return (
    <div className={classes.tableGrid}>
      <div className={classes.table}>
        <table>
          <tr>
            <th>Agency Name</th>
            <th>Employees</th>
            <th>Approved</th>
            <th>To Agency</th>
            <th>Amount to Pay</th>
            <th>Paid</th>
            <th>Balance</th>
            <th>Agency to Employee</th>
            <th>Aadhaar</th>
            <th>Leave</th>
          </tr>
          {data.map((val, key) => {
            return (
              <tr key={key}>
                <td>{val.name}</td>
                <td>{val.age}</td>
                <td>{val.gender}</td>
              </tr>
            );
          })}
        </table>
      </div>
    </div>
  );
}

export default Table;
